if(LFRD_LFR_Filter=="LFRD_RFRD"){
	write(RX_Obj1, 0x60440002);	/* RFRD */
	write(TX_Obj1, 0x60420002);	/* LFRD */
}
if(LFRD_LFR_Filter=="LFR_RFR"){
	write(RX_Obj1, 0x20020302);	/* RFR */
	write(TX_Obj1, 0x20370302);	/* LFR */
}
if(DigitalOutputMode01=="actionDO"){
	write(TX_Obj4, 0x20163E02);	/* AO1R */
}
if(SDC_Mode==0){}else{
	write(SDC_Mode_Output, SDC_Mode);
	write(SDC_IOPrescaler_Output, SDCAIOPrescaler);
}
write(RX_EnableMask_Output, 0xffffffff);
write(TX_EnableMask_Output, 0xffffffff);
write(Cyclic_Mode_Output, 1);
write(OutputConfiguration01, 0x00
| DigitalOutputMode01=="actionDO"		? 0x02	: 0x00
| 0x01);
